import ReactDOM from 'react-dom';
// import App from './App';

const company = ["Android","Blackberry","Iphone","Window Phone"];

ReactDOM.render(
   React.createElement("div",{},
   <h1>Mobile Operating System</h1>,
   React.createElement("ul",{},
     company.map((phone)=>{
       return (
        <li>{phone}</li>
       )
     })
   )
   ),
  document.getElementById('root')
);

